  conll="# text = افتتح المركز الاقليمي العربي ل الاتحاد النسائي الديموقراطي العالمي مؤتمر ه الثالث عشر تحت عنوان " مناضلات ضد العولمة الليبرالية من اجل سلام عادل و مساواة في الحقوق " ، امس في قصر الاونيسكو ، في حضور ممثلة اللبنانية الاولى السيدة نجاة دياب ، و النائبة نايلة معوض ، و ممثل قائد الجيش العقيد علي الدقدوقي ، و نقيب الصحافة محمد بعلبكي و رئيسة الاتحاد سيلفي جان ، و نائبة الرئيسة ميادة عباسي ، و رئيسة لجنة حقوق المرأة اللبنانية و منسقة المركز الاقليمي العربي ل الاتحاد ليندا مطر ، و رئيسة المجلس النسائي اللبناني اقبال دوغان ، و نائبة رئيسة لجنة حقوق المرأة في البرلمان الاوروبي ماريان اريكسون ، و رئيسات الهيئات النسائية في لبنان و ممثلي الهيئات الثقافية و الاجتماعية و الإعلامية و الشبابية ، و وفود عربية و دولية من اوروبا و أميركا اللاتينية و أفريقيا و آسيا .
